import './App.css';
import React from 'react';
import { useTranslation } from 'react-i18next';



function App() {
  const { t, i18n } = useTranslation();
  let culture = "fr";
  return (
    <div className="App">
      <header className="App-header">
      <h1>{t("title-"+culture)}</h1>
      <button onClick={() => {i18n.changeLanguage("fr");}}>fr</button>
      <button onClick={() => {i18n.changeLanguage("fr");culture = "ca"}}>fr-ca</button>
      <button onClick={() => {i18n.changeLanguage("en");}}>en-uk</button>
      <button onClick={() => {i18n.changeLanguage("en");}}>en-usa</button>
      <button onClick={() => {i18n.changeLanguage("en");}}>en-aus</button>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
